} 

<button type="button" onClick={showsignup} >Signup</button>
 const Signup = (props) => {
    return (
        <div >
         <h1>MY dude</h1>
         <input type={props.type} ></input>
         <button type="button" onClick={showsignup} >Signup</button>
        </div>
       
    );

}
 
